-- Name: cancelorderitem(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION cancelorderitem(integer, integer, integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$

DECLARE
    orderId ALIAS FOR $1;
    orderDetailId ALIAS FOR $2;
    voidItemUser ALIAS FOR $3;
    item_void_status boolean;
    v_order_status boolean;
    item_details_record RECORD;
    isItemDivided boolean;
    isParentItem boolean;
    parentOrderDetailId INTEGER;
    
    
BEGIN
    v_order_status := false;
    
    SELECT INTO isItemDivided,isParentItem ,parentOrderDetailId
    is_item_divided,is_parent_item,parent_order_detail_id 
    FROM tbl_order_details
    WHERE order_id = orderId and order_detail_id = orderDetailId;
    
    if isItemDivided = true then
        if isParentItem = true then
            parentOrderDetailId := orderDetailId;
        end if;
        update tbl_order_details set void_status = true,void_item_by=voidItemUser where order_id = orderId and order_detail_id = orderDetailId;
        update tbl_order_details set void_status = true,void_item_by=voidItemUser where order_id = orderId and parent_order_detail_id = parentOrderDetailId;
    else
        update tbl_order_details set void_status = true,void_item_by=voidItemUser where order_id = orderId and order_detail_id = orderDetailId;
    end if;
    
    for item_details_record IN SELECT VOID_STATUS FROM tbl_order_details where order_id = orderId LOOP
        item_void_status := item_details_record.void_status;
        if item_void_status  = false then
            v_order_status := true;
            EXIT;   
        END IF;
        
    END LOOP;
    
    if v_order_status = false then
        update tbl_orders set order_status=false,void_order_by = voidItemUser where order_id = orderId;
    END IF;
    
    RETURN v_order_status;  
    
END;
$_$;


