--
-- Name: checktemporders(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION checktemporders() RETURNS boolean
    LANGUAGE plpgsql
    AS $$











DECLARE
    current_time_value NUMERIC;
    temp_time_value   NUMERIC;
    order_record      RECORD;
    order_detail_record RECORD;
    topping_record     RECORD;
    extras_record      RECORD;
    difference_value   INTEGER;
    orderId        INTEGER;
    splitOrderId       VARCHAR;
    return_value       BOOLEAN;
    parentOrderDetailId INTEGER;
    newOrderDetailId   INTEGER;
    tempOrderId        INTEGER;

BEGIN
    return_value := false;
    FOR order_record in select * from tbl_temp_orders
    LOOP
    	select into current_time_value extract(epoch from current_timestamp);
    	temp_time_value := extract(epoch from order_record.notify_date);
    	temp_time_value := temp_time_value/60;
    	current_time_value := current_time_value/60;
    	difference_value:= floor(temp_time_value - current_time_value);
    	
    	if(difference_value < 10) THEN
    	    select into orderId nextval('ordersequence');
    	    splitOrderId := orderId || 'A';
    	    tempOrderId := order_record.temp_order_id;
    	               ORDER_ID,
    	               FORM_PAYMENT_ID,
    	               CUSTOMER_ID,
    	               TOTAL,
    	               TAX,
    	               ORDER_STATUS,
    	               COOK_STATUS,
    	               BILL_STATUS,
    	               DELIVERY_STATUS,
    	               DELIVERY_TYPE,
    	               DELIVERY_CHARGE,
    	               ORDERED_BY,
    	               DRIVER_ID,
    	               DELIVERY_DATE,
                       COOK_NOTES ,
                       zoom_status,
                       house_account_by,
                       cc_seq,
                       cc_ref_id,
                       cc_captured,
                       actualtotal,
                       code,
                       code_status,
                       credit_card_type)
    	
    	               VALUES(now() ,
    	                         orderId ,
                       		order_record.form_payment_id,
                       		order_record.customer_id ,
                       		order_record.TOTAL ,
                       		order_record.TAX ,
                       		true ,
                       		false,
                       		false,
                       		false,
                       		order_record.delivery_type ,
                       		order_record.delivery_charge,
                       		order_record.ordered_by,
                       		order_record.driver_id,
                       		order_record.delivery_date,
                                 order_record.COOK_NOTES,
                                 false ,
                                order_record.house_account_by,
                                order_record.cc_seq,
                                order_record.cc_ref_id,
                                order_record.cc_captured,
                                order_record.actualtotal,
                                order_record.code,
                                order_record.code_status,
                                order_record.credit_card_type);
             for order_detail_record in select * from tbl_temp_order_details where temp_order_id = tempOrderId
             LOOP
                SELECT INTO newOrderDetailId NEXTVAL('orderdetailsequence');
                IF order_detail_record.is_parent_item = true
                THEN
                    parentOrderDetailId := newOrderDetailId;
                else if order_detail_record.is_item_divided = false
                THEN
                    parentOrderDetailId := 0;
                END IF;
                END IF;
                  ITEM_ID,COOK_STATUS,ITEM_PRICE,ITEM_TAX,
                  QUANTITY, SPLIT_ORDER_ID,
                  COMMENTS,HOTNESS,TOPPINGS,OPTIONS,EXTRAS,
                  MODIFIED_PRICE,MODIFIED_PRICE_BY,
                  EXTRAS_PRICE,TOPPING_PRICE,SIZE_PRICE ,
                  IS_ITEM_DIVIDED,DIVIDED_VALUE,IS_PARENT_ITEM,
                  PARENT_ORDER_DETAIL_ID,item_print_status,void_status,size,item_print_expediter_status,
                  cc_seq,cc_ref_id,cc_captured )
                  VALUES(now(),
                  	newOrderDetailId,
                  	orderId,order_detail_record.item_id ,
                  	false,order_detail_record.item_price,
                  	order_detail_record.item_tax,
                  	order_detail_record.quantity,
                  	splitOrderId,
                  	order_detail_record.comments,
                  	order_detail_record.hotness,
                  	order_detail_record.toppings,
                  	order_detail_record.options,
                  	order_detail_record.extras,
                  	order_detail_record.modified_price,
                  	order_detail_record.modified_price_by,
                  	order_detail_record.extras_price,
                  	order_detail_record.topping_price,
                  	order_detail_record.size_price,
                  	order_detail_record.is_item_divided,
                  	order_detail_record.divided_value,
                  	order_detail_record.is_parent_item,
                  	parentOrderDetailId,
                        false,
                        order_detail_record.void_status,
                        order_detail_record.size,false,
                        order_detail_record.cc_seq,
                        order_detail_record.cc_ref_id,
                        order_detail_record.cc_captured);



            FOR topping_record in select * from tbl_temp_order_item_toppings where temp_order_id = tempOrderId  and order_detail_id=order_detail_record.temp_order_detail_id
            LOOP
                 		order_item_topping_id,
                 		order_id,
                 		item_id ,
                 		topping_id,
                 		isdefault ,
                 		isselected ,
                 		ishalf   ,
                 		isdouble ,
                 		side     ,
                 		area     ,
                 		location ,
                 		amount,
                 		order_detail_id
                          )
 			  values(
 			  	nextval('order_item_topping_id_sequence') ,
 			  	orderId,
 			  	topping_record.item_id,
 			  	topping_record.topping_id,
 			  	topping_record.isdefault,
 			  	topping_record.isselected,
 			  	topping_record.ishalf,
 			  	topping_record.isdouble ,
 			  	topping_record.side,
 			  	topping_record.area,
 			  	topping_record.location,
 			  	topping_record.amount,
                                newOrderDetailId);
 		
            END LOOP;




            END LOOP;

            FOR extras_record in select * from tbl_temp_order_item_extras where temp_order_id = tempOrderId
            LOOP
            		nextval('order_item_extras_sequence'),
            			orderId,
            			extras_record.item_id,
            			extras_record.extras_id );
            			
            END LOOP;
            UPDATE TBL_ORDER_COOK_UPDATE SET ORDER_UPDATED=TRUE;
            delete from tbl_temp_orders where temp_order_id = tempOrderId;
            delete from tbl_temp_order_details where temp_order_id =tempOrderId;
            delete from tbl_temp_order_item_toppings where temp_order_id = tempOrderId;
            delete from tbl_temp_order_item_extras where temp_order_id = tempOrderId;
            return_value := true;
       END IF;

    END LOOP;

    return return_value;

END;
$$;


