CREATE FUNCTION copyclass(character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$
      
      
      
      
      
      DECLARE
          className ALIAS FOR $1;
          returnValue BOOLEAN := FALSE;
          class_record RECORD;
          item_record RECORD;
          subclass_record RECORD;
          quantity_record RECORD;
          extras_record    RECORD;
          ingredient_record RECORD;
          topping_record   RECORD;
          subitem_record   RECORD;
          customerInfo_record RECORD;
          newClassName VARCHAR;
          newItemId    INTEGER;
          newquantityId  INTEGER;
          newExtrasId    INTEGER;
          newSearchId  varchar;
      BEGIN
          newClassName := className || ' COPY ';
      
          FOR subclass_record in select distinct subclass from tbl_items where class = className
          LOOP
      
              FOR item_record in select * from tbl_items where class = className AND subclass = subclass_record.subclass
              LOOP
                  select into newItemId nextval('itemsequence');
                  select into newSearchId (select  max(int8(searchid)+1) from tbl_items);
                              module,
                              name,
                              break_price,
                          lunch_price,
                          dinner_price,
                          brunch_price,
                          happy_hour ,
                          midnight_price ,
                          special_price  ,
                          class        ,
