--
-- Name: dailyclose(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION dailyclose(character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$


DECLARE
    cur_day   ALIAS FOR $1;
    return_value   BOOLEAN;
    close_record   RECORD;
    g_count            INTEGER;

BEGIN
    return_value := false;
    select INTO g_count  count(*) From tbl_daily_close where
        present_date = current_date and upper(present_day) = upper(cur_day)
        and update_status = true;

     IF g_count = 1 THEN     
    ELSE
        update tbl_daily_close set present_date = current_date,update_status = false where upper(present_day) = upper(cur_day);

        for close_record in select true as updated from tbl_daily_close where present_date = current_date and ((to_number(extract(hour from now()),99) >= to_number(substring(close_time from 1 for 2),99) and to_number(extract(minute from now()),99) >= to_number(substring(close_time from 4 for 2),99)) or to_number(extract(hour from now()),99) > to_number(substring(close_time from 1 for 2),99)) and upper(present_day)=upper(cur_day) and update_status = false LOOP
        return_value := close_record.updated;

        END LOOP;
    End IF;

    return return_value;

END;
$_$;


