-- Name: deleteclass(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION deleteclass(character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$


DECLARE
    className ALIAS FOR $1;
    returnValue BOOLEAN := FALSE;
    subclass_record RECORD;
    item_record RECORD;
    
BEGIN 
    
    FOR subclass_record in select subclass from tbl_items where class = className
    LOOP
 
        FOR item_record in select item_id from tbl_items where class = className AND subclass = subclass_record.subclass 
        LOOP
               
        delete from tbl_quantity where item_id = item_record.item_id;
    
	    delete from tbl_extras where item_id = item_record.item_id::text;
            
            delete from tbl_item_inventory where item_id = item_record.item_id;
            
        delete from tbl_item_toppings where item_id = item_record.item_id;
        
        delete from tbl_item_subitems where item_id = item_record.item_id;
        
        delete from tbl_customer_item_info where item_id = item_record.item_id;
        
        delete from tbl_items where item_id = item_record.item_id;
        
    END LOOP;
    
        returnValue := true;
        
    END LOOP;
    
    return returnValue;
    
END;
$_$;


