--
-- Name: doinventorycheck(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION doinventorycheck(integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$

DECLARE
    
    orderId                     ALIAS FOR $1;
    ineventory_record           RECORD;
    ing_quantity                NUMERIC := 0;
    top_quantity                NUMERIC := 0;
    ingredient_inventoryId      INTEGER;
    topping_inventoryId         INTEGER;
    return_value                BOOLEAN;
    

BEGIN    
    return_value := true;
    
    for ineventory_record in SELECT c.INVENTORY_ID AS ID,
            SUM(a.QUANTITY*b.QUANTITY*CONVERSION_FACTOR) AS QUANTITY 
            FROM TBL_ORDER_DETAILS a,
            TBL_ITEM_INGREDIENTS b,
            TBL_INGREDIENTS c,
            TBL_CONVERSION_UNITS d,
            TBL_INVENTORY e 
            WHERE a.ITEM_ID = b.ITEM_ID AND 
            b.INGREDIENT_ID=c.INGREDIENT_ID AND 
            c.INVENTORY_ID = e.INVENTORY_ID AND 
            UPPER(d.FROM_UNIT) = UPPER(b.UNITS) AND 
            UPPER(d.TO_UNIT) = UPPER(e.STOCK_UNITS) AND 
            a.ORDER_ID=orderId GROUP BY C.INVENTORY_ID 
    LOOP
    
        ing_quantity := ineventory_record.QUANTITY;
        ingredient_inventoryId := ineventory_record.ID;
        
        UPDATE TBL_INVENTORY SET QTY_IN_HAND = QTY_IN_HAND - ing_quantity,
                QTY_USED = QTY_USED +ing_quantity WHERE INVENTORY_ID= ingredient_inventoryId;
        
        UPDATE TBL_INVENTORY SET ACTION='ORDER' WHERE THRESHOLD_LEVEL >= QTY_IN_HAND;                
        
        UPDATE TBL_INVENTORY SET ACTION='OK' WHERE THRESHOLD_LEVEL < QTY_IN_HAND;
    
    END LOOP;                
    
    return return_value;
    
END;
$_$;


