--

CREATE FUNCTION getdriveoutdifference(integer, character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$

DECLARE
    employeeId ALIAS FOR $1;
    orderId ALIAS FOR $2;
    driverOutDiff VARCHAR;
    current_time_value NUMERIC;
    drive_out_time_value NUMERIC;
    drive_out_record TBL_DRIVER_CHECKIN.DRIVE_OUT_TIME%TYPE;
    drive_in_record  TBL_DRIVER_CHECKIN.DRIVE_IN_TIME%TYPE;
    difference_time NUMERIC;
    error_status VARCHAR;
    drive_in_time_value NUMERIC;
    
    
BEGIN
    
    select INTO drive_out_record DRIVE_OUT_TIME from TBL_DRIVER_CHECKIN 
        where employee_id = employeeId and order_id = orderId 
        and DRIVE_IN_TIME IS NOT NULL
        and to_char(DRIVE_OUT_TIME,'DD-MON-YYYY') =
            to_char(timestamp 'now','DD-MON-YYYY');
            
    select into drive_out_time_value extract(epoch from drive_out_record); 
    
    drive_out_time_value = drive_out_time_value/60;
    
    IF drive_out_record IS NULL THEN
        
        select INTO drive_in_record max(DRIVE_IN_TIME) FROM
            TBL_DRIVER_CHECKIN where 
            EMPLOYEE_ID = employeeId AND 
            to_char(drive_in_time,'DD-MON-YYYY') = to_char(timestamp 'now','DD-MON-YYYY');
        IF drive_in_record IS NOT NULL THEN
                    
            drive_in_time_value := extract(epoch from drive_in_record);
            drive_in_time_value := drive_in_time_value /60;
            difference_time := drive_in_time_value - drive_out_time_value ;
            driverOutDiff := CAST(difference_time as INTEGER) || ' MI ';
        END IF  ;
               
    END IF;
    
    RETURN driverOutDiff;    
        
END;
$_$;


