--
-- Name: getdriverdeliverystatus(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getdriverdeliverystatus(integer, integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$

DECLARE
    orderId    ALIAS FOR $1;
    employeeId ALIAS FOR $2;
    driverDeliveryStatus boolean;
    order_time      TBL_ORDERS.DATE%TYPE;
    drive_out_record TBL_DRIVER_CHECKIN.DRIVE_OUT_TIME%TYPE;
    drive_in_record  TBL_DRIVER_CHECKIN.DRIVE_IN_TIME%TYPE;

BEGIN
    IF employeeId is NULL THEN
       driverDeliveryStatus := false ;
       return driverDeliveryStatus;
    END IF;

    select into order_time DATE from
            tbl_orders where order_id = orderId
            and driver_id = employeeId ;

    select INTO drive_out_record,drive_in_record DRIVE_OUT_TIME,
            DRIVE_IN_TIME from TBL_DRIVER_CHECKIN
        where employee_id = employeeId
        and order_id = orderId
        and to_char(DRIVE_OUT_TIME,'DD-MON-YYYY') =
            to_char(timestamp 'now','DD-MON-YYYY')
        and DRIVE_OUT_TIME > order_time;

    IF drive_out_record IS NULL THEN
        driverDeliveryStatus := false ;
    ELSE IF drive_out_record IS NOT NULL AND drive_in_record IS NULL THEN
        driverDeliveryStatus :=  false ;
    ELSE IF drive_in_record IS NOT NULL AND drive_in_record > order_time THEN
        driverDeliveryStatus := true;
    END IF;
    END IF;
    END IF;

    RETURN driverDeliveryStatus;

END;
$_$;


