--
-- Name: getdriverstatus(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getdriverstatus(integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$

DECLARE
    employeeId ALIAS FOR $1;
    driverStatus VARCHAR;
    current_time_value NUMERIC;
    drive_out_time_value NUMERIC;
    clock_in_time_value NUMERIC;
    drive_out_record TBL_DRIVER_CHECKIN.DRIVE_OUT_TIME%TYPE;
    drive_in_record  TBL_DRIVER_CHECKIN.DRIVE_IN_TIME%TYPE;
    clock_in_record  TBL_SALARY.CLOCK_IN%TYPE;
    difference_time NUMERIC;
    error_status VARCHAR;
    drive_in_time_value NUMERIC;
    
    
BEGIN
    
    select INTO drive_out_record DRIVE_OUT_TIME from TBL_DRIVER_CHECKIN 
        where employee_id = employeeId and DRIVE_IN_TIME IS NULL
        and to_char(DRIVE_OUT_TIME,'DD-MON-YYYY') =
            to_char(timestamp 'now','DD-MON-YYYY');
    select into current_time_value extract(epoch from current_timestamp); 
    
    current_time_value = current_time_value/60;
    
    IF drive_out_record IS NULL THEN
        
        select INTO drive_in_record max(DRIVE_IN_TIME) FROM
            TBL_DRIVER_CHECKIN where 
            EMPLOYEE_ID = employeeId AND 
            to_char(drive_in_time,'DD-MON-YYYY') = to_char(timestamp 'now','DD-MON-YYYY');
        IF drive_in_record IS NULL THEN
                    
            select INTO clock_in_record CLOCK_IN FROM TBL_SALARY WHERE
                employee_id = employeeId and CLOCK_OUT IS NULL AND
                CLOCK_IN IS NOT NULL AND 
                to_char(clock_in,'DD-MON-YYYY') = to_char(timestamp 'now','DD-MON-YYYY');
            clock_in_time_value := extract(epoch from clock_in_record);
            
            clock_in_time_value := clock_in_time_value /60;
            difference_time  := current_time_value - clock_in_time_value;
            driverStatus := 'CLOCK IN ' || CAST(difference_time as INTEGER)|| ' MI ';
        ELSE
            drive_in_time_value := extract(epoch from drive_in_record);
            drive_in_time_value := drive_in_time_value /60;
            difference_time := current_time_value - drive_in_time_value;
            driverStatus := ' DRIVE IN ' || CAST(difference_time as INTEGER) || ' MI ';
        END IF  ;
        
    ELSE
        drive_out_time_value := extract(epoch from drive_out_record);
        drive_out_time_value := drive_out_time_value / 60;
        difference_time := current_time_value - drive_out_time_value;
        driverStatus := ' DRIVE OUT ' || CAST(difference_time as INTEGER) || ' MI ';
        
        
    END IF;
    
    RETURN driverStatus;    
        
END;
$_$;


