--
-- Name: getmileagecharge(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getmileagecharge(integer) RETURNS double precision
    LANGUAGE plpgsql
    AS $_$




DECLARE
    driverId ALIAS FOR $1;
    mileageCharge DOUBLE PRECISION;
    orderPrice NUMERIC;
    totalOrderPrice double precision := 0;
    zoneMileageCharge double precision := 0;
    orderRecord   RECORD;
    orderDetailRecord   RECORD;
    currentOrderId INTEGER;
    itemPrice   double precision;
    mileagePercentage BOOLEAN;
    mileageType VARCHAR(50);
    orderCount        INTEGER;

BEGIN
    orderCount := 0;
    if driverId = null  then
       RETURN 0.0;
    ELSE IF driverId is NULL THEN
       RETURN 0.0;
    END IF;
    END IF;

    SELECT INTO mileageCharge,mileagePercentage,mileageType mileage_charge, mileage_percentage, mileage_type
            FROM tbl_employee WHERE employee_id=driverId;
    FOR orderRecord in select * from tbl_orders where delivery_type = 'DELIVERY'
            and driver_id = driverId and bill_status = false and order_status = true  and order_delivery_status='DELIVERED'
    LOOP
        currentOrderId := orderRecord.order_id;
        FOR orderDetailRecord in select * from tbl_order_details where
                       order_id = currentOrderId and void_status = false
        LOOP
            IF orderDetailRecord.modified_price = 0  AND
                ( orderDetailRecord.modified_price_by is null
                    OR
                  orderDetailRecord.modified_price_by='null')
            THEN
                   itemPrice := orderDetailRecord.item_price;
            ELSE
                   itemPrice := orderDetailRecord.modified_price;
            END IF;
            totalOrderPrice := totalOrderPrice + itemPrice ;
        END LOOP;
        zoneMileageCharge:= zoneMileageCharge + orderRecord.delivery_charge ;
        orderCount := orderCount + 1;
    END LOOP;

    IF(orderCount = 0)
    THEN
        RETURN 0.00;
    END IF;

    IF (mileageType='zone')
    THEN
        mileageCharge := zoneMileageCharge;
    ELSE
        IF (mileagePercentage = false)
        THEN
            mileageCharge := mileageCharge * orderCount;
        ELSE
            mileageCharge := ( totalOrderPrice * mileageCharge)/100;
        END IF;
    END IF;

    RETURN mileageCharge;
END;
$_$;


