CREATE FUNCTION getorderdriverstatus(integer, integer) RETURNS character varying
    LANGUAGE plpgsql
    AS $_$

DECLARE
    orderId    ALIAS FOR $1;
    employeeId ALIAS FOR $2;
    driverStatus VARCHAR;
    order_time_value NUMERIC;
    order_time      TBL_ORDERS.DATE%TYPE;
    drive_out_time_value NUMERIC;
    drive_out_record TBL_DRIVER_CHECKIN.DRIVE_OUT_TIME%TYPE;
    drive_in_record  TBL_DRIVER_CHECKIN.DRIVE_IN_TIME%TYPE;
    difference_time NUMERIC;
    drive_in_time_value NUMERIC;
    
    
BEGIN
