            tbl_orders where order_id = orderId;    
            
    select INTO drive_out_record,drive_in_record DRIVE_OUT_TIME,
            DRIVE_IN_TIME from TBL_DRIVER_CHECKIN 
        where employee_id = employeeId 
        and to_char(DRIVE_OUT_TIME,'DD-MON-YYYY') =
            to_char(timestamp 'now','DD-MON-YYYY')
