--
-- Name: getprice(integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION getprice(integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $_$


DECLARE
    itemId ALIAS FOR $1;
    now_hour INTEGER;
        now_minute INTEGER;
        now_day VARCHAR;
    shift_start_hour INTEGER;
    shift_start_minute INTEGER;
    shift_end_hour INTEGER;
    shift_end_minute INTEGER;
    shift_record RECORD;
    shift_type varchar;
    item_price NUMERIC;


BEGIN
    shift_type := 'NULL';
    now_hour := to_number(to_char(now(),'HH24'),'99');
    now_minute := to_number(to_char(now(),'MI'),'99');
    now_day  := to_char(now(),'dy');

    for shift_record IN SELECT * FROM tbl_shift_times where lower(day) = lower(now_day) LOOP
        shift_start_hour :=  substring(shift_record.start_time from 1 for position(':' in shift_record.start_time)-1);
        shift_start_minute :=  substring(shift_record.start_time from  position(':' in shift_record.start_time)+1);
        shift_end_hour := substring(shift_record.end_time from 1 for position(':' in shift_record.end_time)-1);
        shift_end_minute := substring(shift_record.end_time from  position(':' in shift_record.end_time)+1);
        if now_hour > shift_start_hour AND now_hour < shift_end_hour then
            shift_type := shift_record.shift;
            EXIT;
        else if now_hour = shift_start_hour AND now_minute >= shift_start_minute then
            shift_type := shift_record.shift;

        else if now_hour = shift_end_hour AND now_minute <= shift_end_minute then

            shift_type := shift_record.shift;
            EXIT;
        END IF;
        END IF;
        END IF;

    END LOOP;

    if shift_type = 'BREAKFAST' then
        select INTO ITEM_PRICE break_price from TBL_ITEMS where ITEM_ID = itemId;
    else if shift_type = 'LUNCH' then
        select INTO ITEM_PRICE lunch_price from TBL_ITEMS where ITEM_ID = itemId;
    else if shift_type = 'DINNER' then
        select INTO ITEM_PRICE dinner_price from TBL_ITEMS where ITEM_ID = itemId;
    else if shift_type = 'BRUNCH' then
        select INTO ITEM_PRICE brunch_price from TBL_ITEMS where ITEM_ID = itemId;
    else if shift_type = 'HAPPYHOUR' then
        select INTO ITEM_PRICE  happy_hour from TBL_ITEMS where ITEM_ID = itemId;
    else if shift_type = 'MIDNIGHT' then
        select INTO ITEM_PRICE   midnight_price from TBL_ITEMS where ITEM_ID = itemId;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    if shift_type = 'NULL' then
        ITEM_PRICE := 0;
    END IF;

    RETURN ITEM_PRICE;

END;
$_$;


ALTER FUNCTION public.getprice(integer) OWNER TO postgres;

