CREATE FUNCTION gettax(integer) RETURNS numeric
    LANGUAGE plpgsql
    AS $_$

DECLARE
    itemId ALIAS FOR $1;
    is_item_taxed1 boolean;
    is_item_taxed2 boolean;
    is_item_special_taxed  boolean;
    item_tax1 NUMERIC;
    item_tax2 NUMERIC;
    special_tax NUMERIC;
    total_tax NUMERIC :=0;
    item_price NUMERIC;
    
BEGIN
    item_price := getPrice(itemId);
    select INTO item_tax1 tax_rate from tbl_tax where tax_id=1;
    select INTO item_tax2 tax_rate from tbl_tax where tax_id=2;
    
    select into is_item_taxed1,is_item_taxed2,is_item_special_taxed ,special_tax taxed1,taxed2,taxed_xtra,percent from tbl_items where item_id = itemId;
    if is_item_taxed1 = true then
        total_tax := total_tax + (item_price * item_tax1)/100;
    END IF;
    if is_item_taxed2 = true then
        total_tax := total_tax + (item_price * item_tax2)/100;
    END IF;
    
    if is_item_special_taxed = true then
        total_tax := total_tax + (item_price * special_tax)/100;
    END IF;
    
    RETURN total_tax;   
    
        
        
END;
$_$;


