    customer_order_detail_record RECORD;
    customer_topping_record RECORD;
    customer_extras_record RECORD;

    return_value       BOOLEAN;
    cust_id ALIAS FOR $1;
    ord_id ALIAS FOR $2;
    cust_order_id INTEGER;
    new_cust_order_id INTEGER;
    parentOrderDetailId INTEGER;
    newOrderDetailId   INTEGER;

BEGIN
    return_value := true;

    for order_record in select * from tbl_orders where order_id = ord_id order by order_id
    LOOP
        if(cust_id <> 'null'  AND cust_id <> '' AND cust_id is not null ) then
            for customer_order_record in select * from tbl_customer_orders where customer_id = cust_id
            LOOP
                cust_order_id := customer_order_record.order_id;
                delete from tbl_customer_order_toppings where order_id = cust_order_id;
                delete from tbl_customer_order_extras where order_id = cust_order_id;
                delete from tbl_customer_order_details where order_id = cust_order_id;
                delete from tbl_customer_orders where order_id = cust_order_id;
            END LOOP;
            select into new_cust_order_id nextval('custordersequence');
                    date ,
                    order_id,
                    total,
                    tax,
                    tag,
                    form_payment_id,
                    order_status,
                    cook_status,
                    bill_status,
                    delivery_status,
                    tip,
                    discount_status,
                    split_status,
                    customer_id,
                    driver_id,
                    delivery_type,
                    ordered_by,
                    bill_payment_by,
                    bill_payment_time,
                    void_order_by,
                    gift_certificate_by,
                    house_account_by,
                    final_total,
                    final_tax,
                    delivery_charge,
                    delivery_date,
                    oven_status,
                    oven_start_time)
                VALUES (order_record.date,
                    new_cust_order_id,
                    order_record.total,
                    order_record.tax,
                    order_record.tag,
                    order_record.form_payment_id,
                    order_record.order_status,
                    order_record.cook_status,
                    order_record.bill_status,
                    order_record.delivery_status,
