--
-- Name: isclassexists(character varying, character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION isclassexists(character varying, character varying) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$

DECLARE
    deliveryType ALIAS FOR $1;
    className ALIAS FOR $2;
    item_record RECORD;
    itemPosition NUMERIC;
    v_class_exists boolean;
    
    
BEGIN
    v_class_exists := false;
    if deliveryType = 'DINE-IN' then
        itemPosition := 1;
    else if deliveryType = 'TO-GO' then
        itemPosition := 2;
    else if deliveryType = 'BUFFET' then
        itemPosition := 3;
    else if deliveryType = 'ITEMS' then
        itemPosition := 4;
    else if deliveryType = 'PARTY-ORDER' then
        itemPosition := 5;
    else if deliveryType = 'BAR' then
        itemPosition := 6;
    else if deliveryType = 'DELIVERY' then
        itemPosition := 7;
    end if;
    end if;
    end if;
    end if;
    end if;
    end if;
    end if;
    
    for item_record IN SELECT NAME,MODULE FROM tbl_items where class = className LOOP
        if substring(item_record.MODULE from itemPosition for 1) = '1' then
            v_class_exists := true;
            EXIT;   
        END IF;
        
    END LOOP;
    
    RETURN v_class_exists;  
    
END;
$_$;


