-- Name: movecustomerorders(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION movecustomerorders() RETURNS boolean
    LANGUAGE plpgsql
    AS $$





DECLARE


    order_record       RECORD;
    order_detail_record RECORD;
    topping_record     RECORD;
    extras_record      RECORD;

    customer_order_record RECORD;
    customer_order_detail_record RECORD;
    customer_topping_record RECORD;
    customer_extras_record RECORD;

    return_value       BOOLEAN;
    cust_id        VARCHAR;
    ord_id     INTEGER;
    cust_order_id INTEGER;
    new_cust_order_id INTEGER;
    parentOrderDetailId INTEGER;
    newOrderDetailId   INTEGER;

BEGIN
    return_value := true;

    for order_record in select * from tbl_orders order by order_id
    LOOP
        cust_id := order_record.customer_id;
        ord_id := order_record.order_id;

        if(cust_id <> 'null'  AND cust_id <> '' AND cust_id is not null ) then
            for customer_order_record in select * from tbl_customer_orders where customer_id = cust_id
            LOOP
                cust_order_id := customer_order_record.order_id;
                delete from tbl_customer_order_toppings where order_id = cust_order_id;
                delete from tbl_customer_order_extras where order_id = cust_order_id;
                delete from tbl_customer_order_details where order_id = cust_order_id;
                delete from tbl_customer_orders where order_id = cust_order_id;
            END LOOP;
            select into new_cust_order_id nextval('custordersequence');
                    date ,
                    order_id,
                    total,
                    tax,
                    tag,
                    form_payment_id,
                    order_status,
                    cook_status,
                    bill_status,
                    delivery_status,
                    tip,
                    discount_status,
                    split_status,
                    customer_id,
                    driver_id,
                    delivery_type,
                    ordered_by,
                    bill_payment_by,
                    bill_payment_time,
                    void_order_by,
                    gift_certificate_by,
                    house_account_by,
                    final_total,
                    final_tax,
                    delivery_charge,
                    delivery_date,
                    oven_status,
                    oven_start_time,
                    room_number)
                VALUES (order_record.date,
                    new_cust_order_id,
                    order_record.total,
                    order_record.tax,
                    order_record.tag,
                    order_record.form_payment_id,
                    order_record.order_status,
                    order_record.cook_status,
                    order_record.bill_status,
                    order_record.delivery_status,
                    order_record.tip,
                    order_record.discount_status,
                    order_record.split_status,
                    order_record.customer_id,
                    order_record.driver_id,
                    order_record.delivery_type,
                    order_record.ordered_by,
                    order_record.bill_payment_by,
                    order_record.bill_payment_time,
                    order_record.void_order_by,
                    order_record.gift_certificate_by,
                    order_record.house_account_by,
                    order_record.final_total,
                    order_record.final_tax,
                    order_record.delivery_charge,
                    order_record.delivery_date,
                    order_record.oven_status,
                    order_record.oven_start_time,
                    order_record.room_number);
                for order_detail_record in select * from tbl_order_details where order_id = ord_id
                LOOP
                    SELECT INTO newOrderDetailId NEXTVAL('custorderdetailsequence');
                    IF order_detail_record.is_parent_item = true
                    THEN
                        parentOrderDetailId := newOrderDetailId;
                    else if order_detail_record.is_item_divided = false
                    THEN
                        parentOrderDetailId := 0;
                    END IF;
                    END IF;
                        ITEM_ID,COOK_STATUS,ITEM_PRICE,ITEM_TAX,
                        QUANTITY,
                        COMMENTS,HOTNESS,TOPPINGS,OPTIONS,EXTRAS,
                        MODIFIED_PRICE,MODIFIED_PRICE_BY,
                        EXTRAS_PRICE,TOPPING_PRICE,SIZE_PRICE ,
                        IS_ITEM_DIVIDED,DIVIDED_VALUE,IS_PARENT_ITEM,
                        PARENT_ORDER_DETAIL_ID )
                        VALUES( order_detail_record.date,
                            newOrderDetailId,
                            new_cust_order_id,
                            order_detail_record.item_id ,
                            false,order_detail_record.item_price,
                            order_detail_record.item_tax,
                            order_detail_record.quantity,
                            order_detail_record.comments,
                            order_detail_record.hotness,
                            order_detail_record.toppings,
                            order_detail_record.options,
                            order_detail_record.extras,
                            order_detail_record.modified_price,
                            order_detail_record.modified_price_by,
                            order_detail_record.extras_price,
                            order_detail_record.topping_price,
                            order_detail_record.size_price,
                            order_detail_record.is_item_divided,
                            order_detail_record.divided_value,
                            order_detail_record.is_parent_item,
                            parentOrderDetailId);






                for topping_record in select * from tbl_order_item_toppings where order_id = ord_id    and order_detail_id=order_detail_record.order_detail_id
                LOOP
                        order_item_topping_id,
                        order_id,
                        item_id,
                        topping_id,
                        isdefault,
                        isselected,
                        ishalf,
                        isdouble,
                        side ,
                        area,
                        location,
                        amount,
                        order_detail_id)
                    VALUES(
                        nextval('custtoppingsequence'),
                        new_cust_order_id,
                        topping_record.item_id,
                        topping_record.topping_id,
                        topping_record.isdefault,
                        topping_record.isselected,
                        topping_record.ishalf,
                        topping_record.isdouble,
                        topping_record.side ,
                        topping_record.area,
                        topping_record.location,
                        topping_record.amount,
                        newOrderDetailId);


                END LOOP;












                END LOOP;


                for extras_record in select * from tbl_order_item_extras where order_id=ord_id
                LOOP
                        order_item_extras_id,
                        order_id,
                        item_id,
                        extras_id)
                     VALUES(
                        nextval('custextrassequence'),
                                    new_cust_order_id,
                        extras_record.item_id,
                        extras_record.extras_id);
                END LOOP;




        END IF;

    END LOOP;

    return return_value;


END;
$$;


