-- Name: updatedailyemployeetable(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION updatedailyemployeetable() RETURNS boolean
    LANGUAGE plpgsql
    AS $$




DECLARE
      employee_record   RECORD;
    return_value       BOOLEAN;

BEGIN
    return_value := false;

    for employee_record in SELECT * FROM TBL_SALARY
    where date < current_date and CLOCK_OUT is null LOOP

       UPDATE TBL_SALARY SET clock_out=( current_date-1 || ' 11:59 PM'),
        hrs=(EXTRACT(EPOCH FROM TO_TIMESTAMP(current_date-1  || ' 23:59',
        'YYYY-MM-DD HH24:MI'))-
           EXTRACT(EPOCH FROM TO_TIMESTAMP(employee_record.clock_in ,
            'YYYY-MM-DD HH24:MI')))/(60*60),auto_status = true
            where employee_id=employee_record.employee_id and employee_record.clock_out is null ;

       return_value := true;

    END LOOP;

    return return_value;
END;
$$;


