-- Name: updatedrivercashout(integer, integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION updatedrivercashout(integer, integer, integer) RETURNS boolean
    LANGUAGE plpgsql
    AS $_$


DECLARE
    driverId ALIAS FOR $1;
    billPaymentUser ALIAS FOR $2;
    machine ALIAS FOR $3;
    totalOrderPrice double precision := 0;
    orderRecord   RECORD;
    orderDetailRecord   RECORD;
    currentOrderId INTEGER;
    itemPrice   double precision;
    orderPrice double precision;
    orderTax double precision;
    driver_coupon double precision;
    driver_tip double precision;
    paymentId INTEGER;
    cardName            CHARACTER VARYING;

BEGIN

    for orderRecord in select * from tbl_orders where delivery_type = 'DELIVERY' and driver_id = driverId and bill_status = false and order_status = true    and order_delivery_status='DELIVERED'
    LOOP
        orderPrice := orderRecord.delivery_charge;
        
        if(orderRecord.coupon_amt is not null) then
            driver_coupon := orderRecord.coupon_amt;
        else
            driver_coupon := 0;
        end if ;

        if(orderRecord.cash_out_tip is not null) then
            driver_tip := orderRecord.cash_out_tip;
        else
            driver_tip := 0;
        end if;

        
        orderTax := 0;
        currentOrderId := orderRecord.order_id;
        cardName       := orderRecord.credit_card_type;
        
        for orderDetailRecord in select * from tbl_order_details where order_id = currentOrderId and void_status = false
        LOOP
            if orderDetailRecord.modified_price = 0  AND
               ( orderDetailRecord.modified_price_by is null OR orderDetailRecord.modified_price_by='null') then
               itemPrice := orderDetailRecord.item_price;
            else
               itemPrice := orderDetailRecord.modified_price;
            end if;
            orderPrice := orderPrice + itemPrice ;
            orderTax := orderTax + orderDetailRecord.item_tax;
        END LOOP;
        
        orderPrice := (orderPrice + driver_tip) - driver_coupon;
        
        UPDATE TBL_ORDERS SET BILL_STATUS = TRUE,BILL_PAYMENT_BY = billPaymentUser,
                        BILL_PAYMENT_TIME = NOW(),
                                DELIVERY_STATUS = TRUE,
                                FINAL_TOTAL = orderPrice,
                                FINAL_TAX = orderTax
                        WHERE ORDER_ID = currentOrderId ;

        UPDATE TBL_ORDER_DETAILS SET BILL_STATUS = TRUE,
                                DELIVERY_STATUS = TRUE
                        WHERE ORDER_ID = currentOrderId AND VOID_STATUS=FALSE ;



            VALUES(currentOrderId,orderRecord.form_payment_id,orderPrice + orderTax,NOW(),cardName);

            VALUES(currentOrderId,orderRecord.form_payment_id,orderPrice + orderTax,NOW(),machine,billPaymentUser);


    END LOOP;
    return true;
END;
$_$;


