--
-- Name: updatemonthlytable(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION updatemonthlytable() RETURNS boolean
    LANGUAGE plpgsql
    AS $$



DECLARE
    employee_record   RECORD;
    g_total_hrs            DOUBLE PRECISION;
    total_break            DOUBLE PRECISION;
    min_from            CHARACTER VARYING;
    return_value       BOOLEAN;
BEGIN
    return_value := true;
    for employee_record in select DISTINCT(employee_id), pay_rate, w2_withheld
            From tbl_employee LOOP
             select into g_total_hrs getpayperiodTotalhrs(employee_record.employee_id);
        IF g_total_hrs = 0 THEN
        ELSE
              select into total_break getpayperiodbreaktime(employee_record.employee_id);
              select into min_from getpayperiodminclockin(employee_record.employee_id);

            VALUES( TO_DATE(min_from, 'MM-DD-YYYY'),
                NOW(),
                employee_record.employee_id,
                g_total_hrs - total_break,
                (g_total_hrs - total_break) * employee_record.pay_rate *
                    (100-employee_record.w2_withheld) * 0.01,
                (g_total_hrs - total_break)* employee_record.pay_rate * employee_record.w2_withheld/100,
                FALSE);

            VALUES(CURRENT_DATE,
                employee_record.employee_id,
                g_total_hrs - total_break,
                (g_total_hrs - total_break)* employee_record.pay_rate * (100-employee_record.w2_withheld)/100,
                (g_total_hrs - total_break)* employee_record.pay_rate * employee_record.w2_withheld/100
            );

            END IF;

    END LOOP;

    return return_value;

END;
$$;


